    - content: >-
        FSC Designer proposition: The Nesasio

        A smaller, more efficient alternative to the current standard combat bomber the Uroglaux.

        The pimrary flaws of the Uroglaux are it's insane fuel consumption and lack of skill in actual ship on ship combat, the nesasio's smaller design and addition of a combat department solve both of these issues. The only real drawback is that there is very little space for storage or systems, so it has been reduced primarily to the necessities which include an engineering room, a medbay, a cryo room, a hacking system, a combat department, a door system, a piloting room, and a break room to keep soldier morale high.

        This ship, if produced on a large scale, will be the new standard for ground support from space during stabilization.
      type: Paper
